const ImageHelper=({product})=>{
    const imageurl=product ? product.image
    :`https://www.google.com/imgres?imgurl=https%3A%2F%2Fwww.cnet.com%2Fa%2Fimg%2F-qQkzFVyOPEoBRS7K5kKS0GFDvk%3D%2F940x0%2F2020%2F04%2F16%2F7d6d8ed2-e10c-4f91-b2dd-74fae951c6d8%2Fbazaart-edit-app.jpg&imgrefurl=https%3A%2F%2Fwww.cnet.com%2Fhow-to%2Fbest-photo-editing-apps-phone-iphone-android%2F&tbnid=h2zUxZ9rtIl5SM&vet=12ahUKEwiQjf3kyKPxAhWhG7cAHSygCDIQMygCegUIARDVAQ..i&docid=DDkHg4NgdVv8gM&w=940&h=705&q=photo&ved=2ahUKEwiQjf3kyKPxAhWhG7cAHSygCDIQMygCegUIARDVAQ`

    return(
        <div className="rounded broder border-success p-2">
            <img scr={imageurl}
            style={{maxHeight:"100%",maxWidth:"100%"}}
            className="mb-3 rounded"
            alt=""/>

        </div>
    );
};

export default ImageHelper;
